{"meta":{"version":1,"small-lines-removed":true},"contents":[{"text":"Frugality
","attributes":{"line":{"header":1}}},{"text":"I have a mental idea of what anything is worth and if it costs more than that I simply forgo it. No matter how much money I have available. That's good for keeping me grounded and such but at times it's too extreme and inconveniences me or others. 

Learn to compromise without fretting and also to buy myself more time sometimes"}]}

{"meta":{"small-lines-removed":true,"version":1},"contents":[{"text":"Feeling marginally better than expected
","attributes":{"line":{"header":1}}},{"text":"Still gonna be a long day and night. 

Off to a good start though by getting some sleep, waking up in time and then basically immediately catching a comfy bus north"}]}

